    def exec_sql_cmd(self, sqlfile, cmd):
        sql = sqlite3.connect(sqlfile)
        cursor = sql.cursor()
        cursor.execute(cmd)
        output = str(cursor.fetchall())
        sql.commit()
        cursor.close()
        sql.close()
        return output
